import React, { useState, useEffect } from "react";

const App = () => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    // Remplacez cette URL par celle d'un flux RSS valide
    const rssFeedUrl = "https://example.com/rss";

    const fetchRSS = async () => {
      try {
        const response = await fetch(
          `https://api.rss2json.com/v1/api.json?rss_url=${encodeURIComponent(
            rssFeedUrl
          )}`
        );
        const data = await response.json();
        if (data.items) {
          setPosts(data.items);
        }
      } catch (error) {
        console.error("Erreur lors de la récupération du flux RSS :", error);
      }
    };

    fetchRSS();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <header className="text-center mb-6">
        <h1 className="text-2xl font-bold text-gray-800">Quantal Fast</h1>
      </header>
      <main className="space-y-4">
        {posts.map((post, index) => (
          <div key={index} className="bg-white shadow-md rounded-lg p-4">
            <h2 className="text-lg font-semibold text-gray-800">{post.title}</h2>
            <p className="text-gray-600 mt-2">{post.contentSnippet}</p>
            <a
              href={post.link}
              target="_blank"
              rel="noopener noreferrer"
              className="text-blue-500 mt-4 inline-block"
            >
              Lire plus
            </a>
          </div>
        ))}
      </main>
    </div>
  );
};

export default App;
